import React from "react";
import Circle from "./Components/Circle.tsx";
import "./App.css";

const App = () => {
  return (
    <>
      <div>
        <Circle courseName={"BioE 10"} id={"bioe10"} />
        <Circle courseName={"BioE 11"} id={"bioe11"} />
      </div>
      <div className="sub-container">
        <div class="circle" id="synthetic">
          Synthetic and Computational Biology
        </div>
        <div class="circle" id="cell">
          Cell & Tissue Engineering
        </div>
        <div class="circle" id="devices">
          Devices
        </div>
        <div class="circle" id="imaging">
          Imaging
        </div>
      </div>
    </>
  );
};

export default App;
